                </div>

            </div>
            <ul className={`md:hidden bg-gray-100 fixed w-full top-0 overflow-y-auto bottom-0 py-20 pl-4 duration-500 ${open ? "left-0" : "left-[-100%]"}`}>
                    <Navlinks/>
                </ul>
        </nav>
    )
}

export default Navbar;
